import React from 'react'
import { BrowserRouter as Router, Switch, Route, Link, useLocation, useParams } from "react-router-dom";
import Button from '@material-ui/core/Button';
import Menu from '@material-ui/core/Menu';
import MenuItem from '@material-ui/core/MenuItem';


function Header() {
    const [anchorEl, setAnchorEl] = React.useState(null);

    const handleClick = (event) => {
        setAnchorEl(event.currentTarget);
    };

    const handleClose = () => {
        setAnchorEl(null);
    };

    return (
        <div className="header">
            <Router>
                <div>
                    <nav>
                        <ul>
                            <li>
                            <Link to="/"><Button aria-controls="simple-menu" aria-haspopup="true">
                                        მთავარი
                                    </Button></Link>
                            </li>
                            <li>
                            <Link to="/about">
                                <div>
                                    <Button aria-controls="simple-menu" aria-haspopup="true" onClick={handleClick}>
                                        ჩვენს შესახებ
                                    </Button>
                                    <Menu id="simple-menu" anchorEl={anchorEl} keepMounted open={Boolean(anchorEl)} onClose={handleClose}>
                                        <Link><MenuItem onClick={handleClose}>ისტორია</MenuItem></Link>
                                        <Link><MenuItem onClick={handleClose}>მისია</MenuItem></Link>
                                        <Link><MenuItem onClick={handleClose}>შინაგანაწესი</MenuItem></Link>
                                        <Link><MenuItem onClick={handleClose}>დირექცია/დირექტორი</MenuItem></Link>
                                    </Menu>
                                </div>
                            </Link>
                            </li>
                            <li>
                            <Link to="/users">Users</Link>
                            </li>
                        </ul>
                    </nav>

                    <Switch>
                        <Route path="/about">
                            <About />
                        </Route>
                        <Route path="/users">
                            <Users />
                        </Route>
                        <Route path="/">
                            <Home />
                        </Route>
                        <Route path="*">
                            <NotFound />
                        </Route>
                    </Switch>
                </div>
            </Router>
        </div>
    )
}
function Home() {
    return <h2>მთავარი</h2>;
}

function About() {
    return <h2>About</h2>;
}

function Users() {
    return <h2>Users</h2>;
}

const NotFound = () => {
    return <>Page not Found {setTimeout(() => { window.location = "/" }, 2000)}</>
}

export default Header
